export default function Login() {
  return (
    <div>
      <h1>Login</h1>
      <div>
        <form>
          <label>Username</label>
          <input type="text" name="username" /> <br />
          <br />
          <label>Password</label>
          <input type="text" name="password" />
        </form>
      </div>
    </div>
  );
}
